import "../css/Home.css"

const Home=()=>{
    return(
        <section class="home" id="home">
        <div class="main-box">
            <div class="content">
                <h1>Find Your Dream House</h1>
                <p>Discover the perfect home for your family with PlanBeeEstate. We offer the best listings for sale and rent in your desired location.</p>
                <a href="#properties" class="btn">Browse Properties</a>
            </div>
        </div>
    </section>
        
    )
}

export default Home;
